import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import apiClient from '../api/apiClient';

const Dashboard = () => {
  const [shipments, setShipments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();
  const userId = localStorage.getItem('userId');
  const userName = localStorage.getItem('userName');

  useEffect(() => {
    fetchShipments();
  }, []);

  const fetchShipments = async () => {
    try {
      setLoading(true);
      const response = await apiClient.get(`/shipment/user/${userId}`);
      setShipments(response.data);
    } catch (err) {
      setError('Failed to fetch shipments');
      console.error('Error fetching shipments:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleDeliverOtp = async (shipmentId) => {
    try {
      await apiClient.post(`/shipment/otp/${shipmentId}`);
      alert('OTP sent to your email!');
      navigate(`/otp-verification/${shipmentId}`);
    } catch (err) {
      setError('Failed to generate delivery OTP');
      console.error('Error generating OTP:', err);
    }
  };

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
        <p>Loading shipments...</p>
      </div>
    );
  }

  return (
    <div>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '2rem' }}>
        <h2>Welcome back, {userName}!</h2>
        <button 
          onClick={() => navigate('/create-shipment')}
          className="btn-success"
        >
          Create New Shipment
        </button>
      </div>

      {error && <div className="error">{error}</div>}

      {shipments.length === 0 ? (
        <div className="card">
          <h3>No Shipments Found</h3>
          <p>You haven't created any shipments yet. Click "Create New Shipment" to get started!</p>
        </div>
      ) : (
        <div className="card">
          <h3>Your Shipments</h3>
          <div style={{ overflowX: 'auto' }}>
            <table>
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Tracking ID</th>
                  <th>Recipient Name</th>
                  <th>Status</th>
                  <th>QR Code</th>
                  <th>Created At</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {shipments.map((shipment) => (
                  <tr key={shipment.id}>
                    <td data-label="ID">{shipment.id}</td>
                    <td data-label="Tracking ID">{shipment.trackingId}</td>
                    <td data-label="Recipient Name">{shipment.recipientName}</td>
                    <td data-label="Status">
                      <span 
                        style={{
                          padding: '0.25rem 0.5rem',
                          borderRadius: '4px',
                          fontSize: '0.875rem',
                          fontWeight: '500',
                          backgroundColor: shipment.status === 'Delivered' ? '#d4edda' : '#fff3cd',
                          color: shipment.status === 'Delivered' ? '#155724' : '#856404'
                        }}
                      >
                        {shipment.status}
                      </span>
                    </td>
                    <td data-label="QR Code">
                      {shipment.qrCodeImage && (
                        <img 
                          src={`data:image/png;base64,${shipment.qrCodeImage}`}
                          alt="QR Code"
                          className="qr-thumbnail"
                          title="Click to view larger"
                          style={{ cursor: 'pointer' }}
                          onClick={() => {
                            // Open QR code in new window for larger view
                            const newWindow = window.open();
                            newWindow.document.write(`
                              <html>
                                <head><title>QR Code - ${shipment.trackingId}</title></head>
                                <body style="display:flex;justify-content:center;align-items:center;min-height:100vh;margin:0;background:#f0f0f0;">
                                  <img src="data:image/png;base64,${shipment.qrCodeImage}" style="max-width:90%;height:auto;" />
                                </body>
                              </html>
                            `);
                          }}
                        />
                      )}
                    </td>
                    <td data-label="Created At">
                      {new Date(shipment.createdAt).toLocaleString()}
                    </td>
                    <td data-label="Action">
                      {shipment.status !== 'Delivered' ? (
                        <button
                          onClick={() => handleDeliverOtp(shipment.id)}
                          className="btn-success"
                          style={{ fontSize: '0.875rem', padding: '0.5rem 1rem' }}
                        >
                          Deliver OTP
                        </button>
                      ) : (
                        <span style={{ color: '#28a745', fontWeight: '500' }}>
                          âœ“ Delivered
                        </span>
                      )}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}

      <div style={{ marginTop: '2rem', textAlign: 'center' }}>
        <button 
          onClick={() => navigate('/track-shipment')}
          className="btn-secondary"
        >
          Track Any Shipment
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
